script:
var rectangle=[
  {
    "type": "rectangle",
    "position": [
      {
        "x": 0.1,
        "y": 0.2
      },
      {
        "x": 0.2,
        "y": 0.3
      }
    ],
    "fillColor": "rgba(255,255,0,0.5)",
  }
]

var counter=0;


move();

function move() {
    API.createData('rectangle', rectangle);
    rectangle[0].position[0].x=counter%10/10;
    rectangle[0].position[1].x=(counter+1)%10/10;
    counter++;
    if (counter>10) return;
    window.setTimeout( move, 500);
}





